import { Link } from "react-router-dom";
import iphoneCategoryImage from "../../images/product_1.png";
import macCategoryImage from "../../images/product_2.png";
import ipadCategoryImage from "../../images/product_3.png";
import watchCategoryImage from "../../images/product_4.png";
import airpodsCategoryImage from "../../images/product_5.png";
import styles from "./Categories.module.css";

const Categories = () => {
  return (
    <>
      <div className="container">
        <h2>Carefully created collections</h2>
        <p>Browse our categories</p>
        <div className="d-flex justify-content-between">
          <Link to="/shop">
            <img src={iphoneCategoryImage} alt="Iphone" />
          </Link>
          <Link to="/shop">
            <img src={macCategoryImage} alt="Mac" />
          </Link>
        </div>
        <div className="d-flex justify-content-between">
          <Link to="/shop">
            <img src={ipadCategoryImage} alt="Ipad" />
          </Link>
          <Link to="/shop">Watch</Link>
          <Link to="/shop">Airpods</Link>
        </div>
      </div>
    </>
  );
};

export default Categories;
